import React from 'react'
import { AboutText } from './AboutText';
import { AboutBackground, StyledContainer } from './StyledAbout';


export const About = () => {
  return (
    <>
    <StyledContainer></StyledContainer>
    <AboutBackground>
        <h1>About Me</h1>
        <AboutText />
    </AboutBackground>
    </>
  )
}
